import { View, Text } from 'react-native'
import React from 'react'
import CarType from '../../component/CarType'
import MapViews from '../../component/MapViews'



const SearchResults = () => {
  return (
    <View>
  <MapViews/>
  <CarType/>
    </View>
  )
}

export default SearchResults
